import '../App.css';
import React from 'react'


    function TodoList({list, remove}) {

    return (
            <div>    

                {list?.length > 0 ? (
                <ul className='todo-List'>
                    {list.map((todo, index)=> (
                    <div className='todo'>
                        <li key={index}>{list}</li>
                        <button className='delete-button'
                            onClick={()=> remove(todo)}
                        >Видалити</button>
                    </div>
                    ))}
                </ul>
            ) : (
                    <div className='empty'>
                        <p>To Do is not found</p>
                    </div>
            )}
            </div>
        )
    }

export default TodoList;
